<?php
function evolve_default_layouts() {
  return '';
}
function evolve_default_presets(){
  return '';
}

/**
 * Implement hook_preprocess_block().
 */
function evolve_preprocess_block(&$vars) {
  $vars['title_attributes_array']['class'][] = 'block-title';
}

/**
 * Implement hook_form_comment_form_alter().
 */
function evolve_form_comment_form_alter(&$form, &$form_state, $form_id) {
  $form['actions']['submit']['#value'] = t('Post Comment');
}

//Improve HTML Validator
function evolve_preprocess_image(&$vars) {
  if(!isset($vars['attributes']['alt'])){
    $vars['attributes']['alt'] = '';
  }
}

/**
 * Implement hook_form_search_block_form_alter().
 */
function evolve_form_search_block_form_alter(&$form) {
  $form['search_block_form']['#attributes']['placeholder'] = t('Start Typing...');
  $form['actions']['#attributes']['class'][] = 'element-invisible';
}

/**
 * Implements hook_preprocess_node().
 */
function evolve_preprocess_node(&$vars) {
  $node = $vars['node'];
  if (isset($vars['view'])){
    $view = $vars['view'];
    $vars['theme_hook_suggestions'][] = 'node__' . $node->type . '__' . $vars['view_mode'].'__'.$view->current_display;    
  }
}

function evolve_button($variables) {
  $element = $variables['element'];
  $element['#attributes']['type'] = 'submit';
  element_set_attributes($element, array('id', 'name', 'value'));

  $element['#attributes']['class'][] = 'form-' . $element['#button_type'];
  if (!empty($element['#attributes']['disabled'])) {
    $element['#attributes']['class'][] = 'form-button-disabled';
  }

  return '<input' . drupal_attributes($element['#attributes']) . ' />';
}
